/***************************************************
*  GMAIL STYLES:
*  These styles will apply to all instances of
*  Gmail - dark mode AND light mode on any device.
*  For HTML usage structure, see below.
**************************************************/
/* keep text black */
u ~ .body .gm-kb-main { color: #000000 !important; }
u ~ .body .gm-kb-outer { background:#fff; mix-blend-mode:difference; }
u ~ .body .gm-kb-inner { background:#fff; mix-blend-mode:difference; }
/* keep text white */
u ~ .body .gm-kw-main { color: #ffffff !important; }
u ~ .body .gm-kw-outer { background:#000; mix-blend-mode:screen; }
u ~ .body .gm-kw-inner { background:#000; mix-blend-mode:difference; }
/****************************************************
* Custom colours - NOTE: these are not exact!
* To use a custom colour, the below code will replace
* the "u ~ .body .gm-xx-main" selector.
***************************************************/
u + .body .dm-anno-dark {
color: #747064 !important;
}
/****************************************************
*   HTML Required structure:
* * * \\=treatascontent(@Mod_Body_Copy)=// * * ***************************************************/
