View this issue on CodePen Wooden Toggles, Responsive Furniture, and a Balance Slider This week's CodePen community highlights include super-skeuomorphic wooden toggle switches from Nicolas Jesenberger, a community roundup of responsive CSS furniture hosted by Ben Evans, and a delightful coffee-fueled balance slider from Jhey Tompkins. Plus, Pedro Ondiviela builds a fun maze puzzler, and Ricardo Oliva Alonso puts together a collection of his wonderful Three.js rooms. pen Wooden Toggles Nicolas Jesenberger draws
