View this issue on CodePen Always Great Grids, JavaScript Sparks, and Bouncy Images This week's CodePen community highlights include an "always great grid" from Adam Argyle, two kinds of sparkling pyrotechnics from Ryan Mulligan and Gabriele Corti, and a bouncy image gallery from Temani Afif. Plus, Amit Sheen live codes an animated tower of climbing cubes, and Josh Bader pays tribute to both the Teenaged Mutant Ninja Turtles and Lego with CSS. pen Rocknot Liam Egan shares a spectacular demonstration of WebGL shader animation & texture in the form of this undulating "rocknot". pen Circular Carousel MotionPath - Draggable & Inertia GreenSock demonstrates the super-realistic interactive movement of their MotionPath plugin with this carousel wheel. Give it a gentle nudge for a slow spin, or give it a good whirl and see how fast it goes! pen Minimalist Lego - TMNT Josh Bader pays homage to his Instagram project Pixel Homage with this Lego-inspired CSS portrait of the Teenaged Mutant Ninja Turtles.
And if that's not enough turtle power for you, andrewrock also illustrated the Turtle Boys this week. pen Click Spark Ryan Mulligan writes about crafting a web component tomake little "sparks (of joy) fly out from the mouse cursor/tap position" in this brief blog post with embedded Pen demo. pen Tower of climbing cubes Neon blocks stack up and climb to infinity in this mesmerizing CSS animation from Amit Sheen.
To see how it was made, check out Amit's live coding session on YouTube . pen Lighten up Gabriele Corti continues a weekly exploration of Zdog with this lovely display of a "few highly-saturated sparks to light up the sky". Part of Gabriele's " Zdog Monday " collection. collection #CodePenChallenge: CSS Illustration For the 2nd week of our CSS Stunts challenge, we did CSS illustrations! Check out our collection from week two, including Pens by Takane Ichinose , Josetxu , sitels , and Andrii Rodzyk . sponsor Master AWS concepts thanks to DoiT Level up your AWS knowledge with the AWS Cookbook, compliments of DoiT, which is packed with tips, tricks, & recipes for success.
DoiT provides technology & cloud expertise to reduce cloud costs & boost engineer productivity. All from an AWS, Microsoft & Google Cloud Partner. pen Wow Winter Blanket It's form over function in this high-style, low-comfort Three.js scene from Anna Zenn Scavenger. "A non-cozy blanket. Now imagine wrapping yourself in it. What a horrible feeling. Brrr." sponsor Get more done with 50% off Slack Pro Slack makes communication easier so your team can stay organized, save time and get more done pen Always great grid Add as many boxes as you like, and stretch or squish the container as much as you want, this CSS grid enhanced with :has() and view transitions is always great! From Adam Argyle. pen Bouncy Image Radio Group Click the images in this gallery to see them bounce gently, then settle in naturally thanks to some slick CSS work with :has() and eased transitions from Temani Afif. Chrisâ€™ Corner A collection of web design and development news and thoughts from CodePen's own Chris Coyier. The â€œswitchâ€ is a pretty common design pattern on the web. Itâ€™s pretty much a checkbox. In fact, under the HTML hood, it really ought to be an <input type="checkbox"> or perhaps a <select> with just two <option> s (or a third if there is an indeterminate state). But unfortunately, the web doesnâ€™t give us any primitive that looks particularly switch-like, as in, some kind of knob that is flipped one way or the other. So we use CSS. For example, we hide the checkbox one way or another, making sure there is still a discoverable clickable area, then with the :checked selector, style something that looks switch-like. Hereâ€™s a very classic example . Marcus Burnette nicely re-creating the iOS toggle look Iâ€™m sure you could imagine using that for, say, toggling email notification settings on an off for some sort of app. We use them here on CodePen quite a bit, for stuff like toggling the privacy of a Pen. Or you might use a toggle to switch a site between dark mode and light mode. Speaking of that, Aleksandr Hovhannisyan has a solid article about the struggles of a dark mode toggle. Youâ€™d think it would be pretty straightforward, but it really isnâ€™t. Consider that users have system-level preferences in addition to your site-level preference, and you have to honor them in the proper order. Plus you have to set the controls properly as well as actually style the site accordingly, ideally without temporarily flashing the wrong colors. ( FART ). Aleksandr does a good job of it and links to other posts that have done a similarly good job. Itâ€™s always way more code than you want it to be, leading me to think browsers and standards could and should get more involved, but I also admit I donâ€™t have a perfect idea on what they should do. Chrome has played with Auto Dark Mode , but itâ€™s not clear how that trial went. (And speaking of Dark Mode, this gallery is pretty nicely done.) Anyway, I was trying to talk about switches! I saw Jen Simmons note that Safari is playing with a native switch. Hereâ€™s the HTML: <input type="checkbox" switch /> Nice. And hereâ€™s what it looks like by default: No big surprise there! Itâ€™s the native iOS toggle come to life. It respects accent-color in CSS like other form controls, which is great. But better, it has really sensible pseudo elements you can grab and style. You get ::thumb and ::track elements (nice clear naming) plus ::before and ::after work on the element itself, so there are a lot of possibilities. .custom-switch {
}
.custom-switch::thumb {
}
.custom-switch::track {
}
.custom-switch:checked::thumb {
}
.custom-switch:checked::track {
}
.custom-switch::checked::after {
}
.custom-switch::checked::before {

