View this issue on CodePen CSS Coincidences, GSAP Lunch, and Abstract Animation This week's CodePen community highlights include a comiCSS coincidence from Alvaro Montoro, a delicious lunchtime with GSAP's ScrollTrigger from Tom Miller, and a beautiful abstract animation of a nighttime drive from wheatup. Plus, Nicolas Jesenberger brings the holiday cheer with a jaunty Santa hat, and Sebastian Schepis takes us into the mysterious world of Tripoles. pen Drive Home (CSS) wheatup evokes the feeling of a moody night time drive with a minimal bokeh dot animation in CSS. Inspired by a GLSL shader from The Art of Code. pen Santa Hat Button It's that time of year! Nicolas Jesenberger brings some Christmas cheer to a button with a little snow shower and a jaunty Santa hat. collection #CodePenChallenge: Gradient Glow We wrapped up the November "Style Trends" challenge with a gradient glow! Check out our collection from week 4, including Pens by Mona Plamondon , Ryan Jagdfeld , Mads Stoumann , and Ismail Vittal . pen Grid Loader (React) Multi-colored dots slide in and out of view with a satisfying, subtle squish in this lovely loader from animation master Chris Gannon. pen Tripoles "Tripoles are digital constructs made of energy and entropy. The Tripoles seen here are constructs made of component objects with the same name - tripoles have the same capabilities all active observers possess - the ability to sense energy, and the ability to mediate it into an action. Turns out all that is needed for enless complexity to arise are the simplest of actions - observation, mediation, actuation. Observers aren't just an emergent afterthought - observation is a fundamental creative force in the Universe." From Sebastian Schepis. pen 25 Seconds of Confetti The Brutal Tooth expands on a tsParticles.js demo from Matteo Bruni to bring us 25 solid seconds of continuous confetti in this playful Pen. pen MÃ¶bius Strip - CSS Josetxu demonstrates some serious clip-path and gradient chops in this CSS rendition of an  infinite mathematical object, the MÃ¶bius strip . sponsor Embeddable Data Importer for Businesses Flatfile makes importing clean & validated customer data fast & easy. Collect dataâ€” CSV, XLSX or moreâ€”via SDK, API, webhooks, or workflows. Leverage AI to transform & match fields that meet your specific format. Revolutionize your businessâ€™s import solution today, it's free! pen Abaclock Mark Boots mixes ancient tech with modern JavaScript & CSS to produce an abacus that tells time! sponsor Multiplayer servers for all your gaming needs Power up your gaming world with an IONOS Dedicated Gaming Server! Take the reins of player interactions, set your game's rules, and tailor the server for epic gaming sessions. With full root access, mold your IaaS to perfectly fit your project's pulse. Game on, your way! pen Just about time for lunch... Tom Miller adds some "GSAP ScrollTrigger magic to this handsome photo by Pablo Merchan " in this luscious luncheon of a Pen. pen comiCSS: Coincidence? Alvaro Montoro recreates the JavaScript "correlation vs. causation" meme with CSS in this thought provoking Pen ğŸ¤” Chrisâ€™ Corner A collection of web design and development news and thoughts from CodePen's own Chris Coyier. Josh Comeau has a new learning guide out for CSS grid: An Interactive Guide to CSS Grid . I like how Josh gets into the â€œmental modelâ€ right away, because thatâ€™s the biggest thing with big APIs like this: you need to get the basics of how it works in your head so you know when and why to reach for it. The niche details are less important. You can look them up. Mostly you need to understand that the thing exists and what it is capable of. Ideally you can write a basic setup from memory. Then the more niche stuff you reference. Joshâ€™s guide, especially with the interactivity, loads you up with that mental model. Josh has done the same before with an An Interactive Guide to Flexbox . The interactive bit goes a long way in locking in that mental model. In my CSS-Tricks days, our guide to flexbox was also decent at explaining the model I think, and also was a decent reference guide at the same time. But it didnâ€™t have that interactivity so people were left to extracting the information to their own code to play. Once people are writing their own layout code, Iâ€™d wager thatâ€™s also a pretty big moment for locking in a mental model. CodePen editable embeds might be a good way to bring that to guides like this. I know that a very lot of people had their ah-ha moment with flexbox via Flexbox Froggy , and I think itâ€™s that combination of interactivity and real code that made that so effective. Speaking of Cool Josh Ideas, have you seen his operator lookup page ? JavaScript has a pretty decent number of operators, and some of them you really have to look up to remember sometimes: Sometimes my brain goesâ€¦ whatâ€™s the one where you set the value, but if the value is null, provide a fallback . Which is this one . Do you know about import maps yet? They arenâ€™t some new niche thing, they are supported across the board . (Well, a little new, maybe). I like Yoshi Huangâ€™s article(s) on them, they do a good job of setting the stage. My brain goes a little like this. This is really common code to see, but itâ€™s actually invalid JavaScript: import lodash from "lodash"; If you see code like that, traditionally , it means that the JavaScript will be going through a processor of some sort that is going to resolve "lodash" to some actual location where that code can be found. If we wanted that code to be valid JavaScript, weâ€™d either have to: Import from a relative file path (e.g. that string has got to start with a dot or a slash) Import from a URL The latter being like: import lodash from ' But now, the original import statement actually is valid. That is, as long as we use an import map. From Yoshiâ€™s article, something like: <script type="importmap">
{
"imports": {
"lodash": "/node_modules/lodash-es/lodash.js"
}
}

