View this issue on CodePen GSAP Mini-Games, Zdog Crafts, and Generative Waves This week's CodePen community highlights include a fun veggie slicing minigame from Tom Miller, a playful Zdog animation in popsicle stick craft style from Gabriele Corti, and an interactive display of generative waves from Lea Rosema. Plus, Jon Kantner shares a bouncy radio button concept, and Ricardo Oliva Alonso takes us on a Three.js restaurant tour. pen Veggie Knight Thanksgiving is coming, time to brush up on your veggie chopping skills! Tom Miller shares a fun GSAP powered mini-game of sliceable emoji vegetables. Slice up as much as you can before the kitchen timer goes off. pen Little Restaurant - ThreeJS Ricardo Oliva Alonso cooks up an appealing restaurant in miniature with Three.js. Click/tap and drag around the scene to explore the room, then go see Ricardo's profile for even more mini-rooms. sponsor Drag & drop authentication for your app Add authentication, user management, and authorization to your website with our no-code workflows and SDKs. Choose from passkeys, magic links, social logins, and more. Sign up for a Free Forever account today - no credit card required. pen Mac OS X Aqua Style Philip Zastrow brings us back to the Cheetah days with this retro aqua button, built with elegant present-day CSS that would astonish a y2k-era web designer. pen Popsicle Art Gabriele Corti's Zdog Monday continues with this cute popsicle-stick airplane model, part of a "pseudo-3D journey of arts and craft". collection #CodePenChallenge: Neo-Brutalism In the 2nd week of our November "Style" challenge we got into the neo-brutalism design style. Check out our collection from week two, including Pens by grimfand , Jim Roberts , Carter Lovelace , and tofjadesign . pen Welcome to Las Vegas Mark Boots recreates the iconic Las Vegas welcome sign in fabulous CSS with a clever combination of filters, transforms, and gradients to get that glowing look. pen Generative Wavy Circles Pick your own colors, blur, and waviness, or just sit back and enjoy the waves in this trippy piece of shader art. It's the 35th Pen in Lea's ongoing #anydayshaders series ğŸŒ€ Check out Lea's #anydayshaders collection for highlights of the series. pen Circle Text Hover Effect The text from a hovered menu item spins around in a subtle circle in this animated text effect concept from Adam Curzon. pen Dropping Radio Buttons Radio button selections stretch and drop down (and hop back up) in this fun animated UI concept from Jon Kantner, inspired by Dribbble shot by Oleg Frolov . Chrisâ€™ Corner A collection of web design and development news and thoughts from CodePen's own Chris Coyier. Iâ€™m a sucker for a new coding font. I generally donâ€™t think what coding font you use affects productivity in any significant way (unless itâ€™s distracting) so farting around and switching it up is just a fun little thing to do. Like pushing around the furniture in your room or taking a different bike route to work. So count me in for playing with GitHubâ€™s new set of monospace coding fonts: Monaspace . (Before I get too far without mentioning it, you can use them on CodePen just by visiting your editor settings and picking one.) The fact that there is five different stylized versions alone is pretty note worthy, but there are a variety of other features that are pretty darn cool. Texture Healing feels like a made up term, but what it does is pretty easy to understand and clearly useful. It basically makes it so wide letters donâ€™t have to scrunch themselves and narrow letters donâ€™t have to exaggerate themselves. They say: Texture healing works by finding each pair of adjacent characters where one wants more space, and one has too much. Narrow characters are swapped for ones that cede some of their whitespace, and wider characters are swapped for ones that extend to the very edge of their box. Which is done with the OpenType feature â€œcontextual alternatesâ€. Itâ€™s a little bit like a ligature, where certain character combinations flop out into a new glyph that works best with them together, only, ya know, slightly different. Monaspace has ligatures too. Ligatures are pretty controversial in coding fonts. For instance some people really hate that != might turn into â‰  as a ligature as that is like a deviation from the literal syntax of the language you may be writing. They arenâ€™t my favorite but itâ€™s not a firmly held opinion and itâ€™s easy enough just to not use them. (They arenâ€™t enabled on CodePen, as it seems like it might be confusing for some beginners.) They come as a variable font, which I love because variable fonts rule. And itâ€™s not a phoned in variable font with one measly axis, itâ€™s weight, and width, and slant, which is wonderful. The download comes both with variable and non-variable versions. If you donâ€™t plan to use the variable-ness, the variable fonts are an order of magnitude larger so probably use the non-variable versions. If itâ€™s not on the web it probably doesnâ€™t matter. Also curious they only shipped .woff and not .woff2 ? My very favorite idea they have around this â€œsuperfamilyâ€ is the idea of mixing and matching them for different reasons in the same UI. The idea of having an italic monospace is starting to be more and more common. Gotta shout out the OG Operator for breaking that ground. Setting comments in italics is still just a super cool idea to me. Now we could use Radon for that, a different typeface entirely designed for it. In the image above, they suggest JSDoc-style comments using Xenon and GitHub CoPilot using Krypton. I love it. Ship it. (But I donâ€™t think itâ€™s possible in VS Code yet, but considering Microsoft makes both, youâ€™d think itâ€™s coming.) To make that possible, essentially, you need syntax highlighting tools to provide tokens/classes that make it easy to identify different aspects of code. Itâ€™s certainly possible, and probably not even that hard, but itâ€™s probably a somewhat tricky thing to roll out with so many third-party themes out there. But anyway, how great is this? If youâ€™re into playing with different coding fonts, well make sure to explore the fact that we have over 20 of them on CodePen to switch between. But of course there are far more than that out in the wild. A great read about the landscape of â€œplayful and funâ€ coding fonts is Doug Wilsonâ€™s Coding with Character . Doug dug (ha) up this great example of IBM â€œSELECTRICâ€ TYPE SAMPLES (literally different typewriter fonts you could swap between by replacing a metal ball in the typewriter): So cool! I love that this new wave of coding fonts is kind of a callback to what was happening here, whether everyone recognizes it or not. The first one Doug mentions is Operator which I used for years and years after it came out and still love. The second is Comic Code: My first thought: This has to be a joke, right?! Comic Sans has a bad reputation and was never meant to be used for codingâ€”but what ifâ€¦? That is what crazy mastermind Toshi Omagari seemed to ask. He says, â€œ Comic Code is a monospaced adaptation of the most over-hated typeface.â€ I havenâ€™t asked, but I feel his thought process may have been something like this GIF . Believe it or not, I think it actually works and certainly brings a smileâ€”or at least a smirkâ€”to your face Totally agree! It works! While I was in our code base putting in the Monaspace fonts, of course I couldnâ€™t resist doing general code cleanup. The Monaspace fonts only ship in .woff, so the @font-face in CSS is pretty much as simple as: @font-face {
font-family: 'Font Name';
src: url('./fonts/font.woff') format('woff');
} You can get away with only shipping in woff2 these days, so some of our fonts that have that format, thatâ€™s exactly what Iâ€™m doing. The simplicity there just feels great since this used to be such a complex bit of code in the past with loads of formats. Then I recently learned from an Ollie Williams blog post that you donâ€™t have to put the format as a string anymore, keywords work, so: @font-face {
font-family: 'Font Name';
src: url('./fonts/font.woff2') format(woff2);

