Gabriele ongoing Zdog Monday series. pen Gorgeous animated gradient borders Jason Lengstorf brings us another take on a pure-CSS animated gradient border, drawing inspiration from an @property tutorial from Temani Afif . Chrisâ€™ Corner A collection of web design and development news and thoughts from CodePen's own Chris Coyier. If you ever need some inspiration for buttons, definitely check out Lucas Bonomiâ€™s buttons.cool . This is a better-than-it-needs-to-be one-off site just for beautiful buttons: But itâ€™s not just a design gallery, itâ€™s made for front-end developers in that you can see the code, see them being live-rendered right on the page, and of course, the best part is you can pop right over to CodePen for a look. Looks like itâ€™s taking submissions . How hard is a Dark Mode to pull off? Or perhaps more accurately, how hard is it to pull off a second color mode? Some of us have dark-mode-first websites, ya know . I thought Wes Bos phrased the question well : Question for those who have implemented light/dark mode: how much is just swapping out variables, and how much is custom code, and tending to edge cases? I answered: fiddy fiddy. In the new version of CodePen weâ€™re working on, we will have a site-wide theme setting (which is separated from what syntax highlighting theme you choose). CodePen being a pretty complex site, it involved quite a bit of CSS custom property setting. So in a sense, it was mostly just â€œswapping out variablesâ€, but quite a few of those variables exist just because of different color modes, most of which I might even call an â€œedge caseâ€. For us: north of 100 south of 200. I found this to be challenging but ultimately a fair approach. Sometimes you see ideas going around of how simple it could be. For instance, heâ€™s Akhil Arjun saying it can be done in one line : html[theme='dark-mode'] {
filter: invert(1) hue-rotate(180deg);
} And hereâ€™s Mads Stoumann with a totally different 3-line approach: body {
background-color: Canvas;
color: CanvasText;
color-scheme: light dark;
} While I appreciate a good CSS trick and these are good things to know about, Iâ€™m going to go ahead and say these super minimal approaches probably arenâ€™t going to get you very far. Youâ€™re going to want better control than this and youâ€™re going to need to deal with those edge cases. Now that we have such powerful layout tools in CSS (keep â€™em coming, CSS!) â€” itâ€™s fun to see little layout situations that look fairly simple but are still a little challenging. Tyler Sticka ran across one he calls Tricky Floating Image Alignment . The idea is to have some text that is center aligned with an image, but if the text grows larger than the image, use the behavior of float . I liked the solution in the end. Itâ€™s a throwback to the way we used to be able to vertically center stuff with top: 50%; transform: translateY(-50%) . This will do the centering nicely, but when the text is bigger than the container, they essentially cancel out and so essentially do nothing. Hereâ€™s another tricky layout situation, this time involving newfangled HTML and CSS features, namely anchor positioning. (Think of it as positioning an element based on another arbitrary elementâ€™s position.) Eric Meyer blogged it as Nuclear Anchored Sidenotes . Imagine a footnote, except on a large enough screen, itâ€™s more like a sidenote. That is, the note goes into empty sidebar space at the exact line that the footnote marker appears on. But to really pull this off, youâ€™re using anchor positions of multiple elements: Yes, Iâ€™m anchoring the sidenotes with respect to two completely different anchors, one of which is a descendant of the other.  Thatâ€™s okay!  You can do that! I did not know you could do that, but I like it. top: anchor(top); /_ implicit anchor _/

