View this issue on CodePen CSS Sci-Fi, Baldur's Gate Buttons, and Divtober Begins This week's CodePen community highlights include a portal into a CSS spaceship from Josetxu, a trio of Baldur's Gate 3-inspired buttons from Aaron Iker, Jane Ori, and Nicolas Jesenberger, and the return of Lynn Fisher's legendary annual single-div CSS illustration challenge Divtober ! Plus, Ben Evans brews up a spectacular pot of CSS coffee, and Jon Kantner brings a new -tober to the table: Clocktober â° pen Pure CSS Moka Pot Ben Evans serves up a terrific pot of CSS coffee with just a dash of HTML â€” and once again, no JavaScript at all! Hover around the scene to see all the angles, and check out the making of video on YouTube . pen Spacecraft SCI-FI Door - Pure CSS "First test of what I hope will be a series of 3D sci-fi spacecraft doors made in pure CSS.
inspired by a vector drawing from Shutterstock . sponsor Work smart, not hard. Easily run builds with Kubes Benefit from managed configurations and updates, allowing your team to focus on developing â€” on secure and scalable infrastructure. pen Skyline Checkboxes Turn the lights on and off in skyscraper windows in this playful Pen showcasing the checkbox hack from Mads Stoumann. pen #Clocktober Day 7: Layered Jon Kantner's a master of intricate UI details, and this month he's turned his attention to front-end clockmaking. This 3D layered Pen is the 7th in a monthlong series. Follow Jon to keep time in your following feed. Chrisâ€™ Corner A collection of web design and development news and thoughts from CodePen's own Chris Coyier. Youâ€™ve seen CSSâ€™ new :has() selector right? There are all these â€œbasicâ€ use cases that leave me smiling because the solutions of the past were inelegant at best, and now are easy and satisfying. Hereâ€™s one: You want margin below your <h2> â€¦ unless there is a <time> right below it, then no margin â€¦ but put the margin below the <time> instead. One approach to this with :has() is just a few lines and reads very clearly to me: h2 {
margin-block-end: 1.2rem;
&:has(+ time) {
margin-block-end: 0;
}
&:has(+ time) + time {
margin-block-end: 1.2rem;
}
