3. Caniuse is a great site for not only checking support but also seeing when versions shipped that have support. Lest I type too many words without explaining what subgrid isâ€¦ itâ€™s a keyword that works with grid-template-columns and grid-template-rows that allow you to suck in the grid lines that pass through the element from the parent grid. .parent {
display: grid;
grid-template-columns: 1fr 1fr 1fr 1fr 1fr;
}
.child {
grid-column: 2 / 4;
display: grid;
grid-template-columns: subgrid;
} Does your browser support it? Probably, but itâ€™s still good to check and to code around that check. Bramus has a Pen thatâ€™s a quicky check. The CSS feature @supports is up for the job: output::after {
content: "âŒ Your browser does not support subgrid";
}
@supports(grid-template-rows: subgrid) {
output::after {
content: "âœ… Your browser supports subgrid";
}

a full screen video as a background at any screen size, with a combo of "absolute positioning, full viewport width and height, and 'object-fit: cover;'" Chrisâ€™ Corner A collection of web design and development news and thoughts from CodePen's own Chris Coyier. SVG has so many tricks up its sleeve. Itâ€™s really a full-featured drawing API literally designed for the web, but few of us really truly understand it nor reach for it enough. Heck, I even wrote a book about it , and I donâ€™t. At the time, just getting people to use SVG for icons felt like an uphill battle, but thankfully, I think that one has been won. Letâ€™s look at some cool SVG examples that have crossed my desk lately. Animate an SVG Shapeâ€™s Inner Stroke Christopher Kirk-Nielsen with a variety of demos that are a good reminder that stroke is animatable (like the width of it), which can do some cool effects. This demo looks like the classic one where the stroke moves to the inside only, filling the shapes. It was only in the last few years that browsers like Chrome GPU accelerated SVG animations , making stuff like this really smooth. SVG viewBox padding To be clear, the viewBox in SVG does not actually have padding. But itâ€™s an important thing to think about. Chuan makes the point that if you make a 10âœ•10 area via the viewBox , then make a <rect> that fills that 10âœ•10 area, the stroke around it, the stroke will be half cut off. Thatâ€™s because stroke straddles the edge of shapes in SVG. So you either gotta monkey with the coordinates of the shapes, or you gotta adjust the viewBox to handle it. Chuanâ€™s thinking is: let a processor handle it. viewBox="0 0 10 10 padding .5"
/_ translates to _/
viewBox="-.5 -.5 11 11" Clever thinking, really. The CSS Doodle tool can do it . Soâ€¦ you can set an SVG circleâ€™s radius in CSS? The very basic answer to Paul Hebertâ€™s questions is: yeah, totally. Like if you have this: <svg viewBox="0 0 100 100" xmlns="
<circle cx="50" cy="50" r="50" />
</svg> You can adjust the radius in CSS like: circle {
r: 20;
} Not CSS you see every day, but yeah, thatâ€™s totally fine. But Paulâ€™s point is that normally you set the radius in the SVG code, but you might need it in CSS code. Like, a way to keep them in sync is good. In Paulâ€™s demo , it looks like he doesnâ€™t even set the radius in SVG at all, just does it in CSS via a --radius Custom Property, then uses that in the other calculations needed to make these percentage meters work. Understanding SVG Paths The <path> element in SVG is the most complicated of the shape drawing elements. In fact, as I understand it, all the other elements are just syntactic sugar over a path anyway. I once wrote An Illustrated Guide when I was learning it and figuring it out. But Nanda Syahrasyad has outdone me easily in Understanding SVG Paths . The trick is understanding the commands. They are pretty understandable in the end, as it were. They are like â€œpick the pen up and move it here, then draw a line over to hereâ€ or â€œstarting where you are, move the pen in this direction this farâ€ or â€œdraw a curve from here to there using these other two points as essentially gravitational poles.â€ If you get into it, youâ€™ll find yourselves (gasp) drawing your own shapes. I love Nandaâ€™s opener: I think youâ€™re kind of a next-level front-end developer if youâ€™re building bending ass buttons like that. SVGs have additional pointer-events properties If youâ€™re like me, you think of pointer-events in CSS as a thing you use to set none once in a while. Maybe you set some colored overlay <div> over something, but you donâ€™t want it to actually eat up clicks, so you set pointer-events: none on it and those clicks will slide right through. When it comes to SVG, though, Stefan Judis has noted some additional values for it that are specific to SVG like: .foo {
pointer-events: visiblePainted;

