View this issue on CodePen Posters, Pointers, and Pulling to Refresh What a great week of interesting work, thanks to you lovely folks in the CodePen community. There is some work inspired by print design, which always makes for interesting results, especially when there are interactive adaptations. New CSS is bustin' still, allowing for interactions that would have been hard or impossible before (see the pull to refresh stuff). Hyperplexed has a new one with his trademark "let's break this complex effect down into smaller problems" approach. And you know what, I think we'll all learn a little something about how coffee drinks are made this week. pen Interactive Art Poster â€” Homage to Gernes Each of the circles is an input of type=color, so you can click or tap them to open a color picker and change them. Open the full Pen to see a dark mode toggle as well. pen Magic Wand Reveal The latest Hyperplexed video is of this interactive wave-across effect that reveals images by moving them from not there at all to adjusting the opacity and blur to bring them in. There is loads of little details to get right though! pen OJaOQwz Dillon says: "Another pen using Bridson's algorithm and Delaunay triangulation.
/* styles when :has() is supported */
} It is useful to think about what your plan is for detection, though. Like does it matter if Firefox doesnâ€™t support :has() for what you are trying to do? Are you prepared to do it some other way if itâ€™s not? As an example, I was talking to Eric Meyer the other day, and somehow table row/column highlighting came up, and he made a demo with :has() . Now youâ€™d have to decide: how important is that effect? As written, in Firefox, just the cell you hover over highlights, so you could decide thatâ€™s fine, and then you donâ€™t need any feature detection at all; you just let it fail. Alternatively, you could decide to use a @supports query in CSS and highlight the entire row if :has() isnâ€™t supported, which is a similar effect (if not quite as cool). Another decision you could make is to do the test in JavaScript and use a JavaScript-powered fallback if necessary. Good news, Stephanie has a JavaScript testing tool just for this. It uses a number of different techniques to report if a feature is supported or not. Ultimately you could use it for our :has() test like: <script type="module">
import * as SupportsCSS from "
const tests = ["has"];
SupportsCSS.init({ tests });
if (!SupportsCSSTests.results.has) {
document.head.insertAdjacentHTML(
"beforeend",
"<style>tr:hover { background: rgba(255,0,0,0.33); }</style>"
);
}
</script> Ya know, just while weâ€™re talking about feature detection in CSS, a typography-specific feature tester crossed my desk the other day, font-tech and font-format : @supports font-tech(palettes) {
.palette {
display: block;
}
}
@supports font-format(woff2) {
div {
display: block;
}
} Just interesting to me; Iâ€™ve never seen those specific functions before. Wait, wait, I gotta do one more about feature detection. There are some things that you cannot detect in CSS, and is kind of a pain in the butt to detect in JavaScript also. Ahmad Shadeed made this point in Do we need CSS flex-wrap detection? The point has been made again and again that we need certain state detections like a :stuck selector for position: sticky; elements, and it sounds likely weâ€™ll get that . But â€œis wrapped or notâ€ is another form of state, Iâ€™d say. Ahmadâ€™s use case was likeâ€¦ if a line in a flexbox layout wraps, itâ€™s saying: â€œthere isnâ€™t room for these on one lineâ€. But where that is is totally arbitrary based on content and element size. But if we knew exactly when that break was, we could, for example, use that exact moment to break a line of navigation into a hamburger rather than guessing at some magic number size. Strong point, I think. I have an unnatural affinity for the â€œyellow fade techniqueâ€. Itâ€™s this idea that works with the :target selector in CSS and on-page anchor links. Imagine a table of contents where you click a link, and it jumps the page down (or scrolls, I suppose if you use scroll-behavior: smooth ). How do you know exactly where the page is trying to take you to and draw your attention toward? The element is probably at the top of the page, but it might not be if the page is too short. The yellow fade technique just makes it way more clear. When that jump happens, that element becomes the : target , and you apply a background-color animation to it (light yellow!) that draws attention to it. Itâ€™s just nice, I think. There are some classic examples on CodePen, naturally. The idea can also be applied to an element being added to the DOM, drawing attention to the fact that it just appeared. Thatâ€™s what Bramus Van Damme does in The Yellow Fade Technique with Modern CSS using @starting-style . Ermâ€¦ @starting-style , whatâ€™s that? Itâ€™s basically built for the yellow fade technique. ğŸ˜. div {
transition: background-color 0.5s;
background-color: transparent;
@starting-style {
background-color: yellow;
}
--bg: hsl(var(--hue) 50% 50%);
}
h1 {
--text: color-contrast(var(--bg) vs black, white);
color: var(--text);
background: hsl(0 0% 0% / 40%);
}
@supports (background: hsl(from red h s l)) {
h1 {
background: oklch(from color-contrast(var(--text) vs black,white) l c h / 40%);
}

& div {
...
}
} Ends up as: :is(main, #intro) div { ... } Which makes it go from 0,0,1 for main div to 1,0,1 making it vastly more specific. Iâ€™m not sure if nesting gotchas is the ultimate example of CSS complexity gone wild, but itâ€™s just one little potential poke. I remember in the Sass heyday that people would point to @extend as a complexity code smell and they werenâ€™t wrong. Perhaps thanks to the scale and pervasiveness of npm, piles of questionable third-party code is another cause of complexity concern on the front-end. Michelle Barker gets into this in Reducing Complexity in Front End Development where sheâ€™s ruminating on Jack Franklinâ€™s recent talk at All Day Hey. A quick look in our Node modules folder quickly exposes the web of complexity within, which few of us can really fathom. A single point of failure can bring down the entire stack, like the well-worn â€œhouse of cardsâ€ metaphor. Reducing dependencies, Iâ€™ll go out on a limb and say, is nearly always â€œworth itâ€ in the sense of saving future-you headaches. Or as grug says: one day code base understandable and grug can get work done, everything good! next day impossible: complexity demon spirit has entered code and very dangerous situation! You can adjust your email preferences any time, or instantly opt out of emails of this kind.
